import React, { useState, Fragment } from 'react';
import SubNav from '../../components/common/layout/SubNav';
import MyListing from './components/MyListing';
import MarketplaceListings from './components/MarketplaceListings';

const Marketplace = () => {
  const [activeSubTab, setActiveSubTab] = useState('marketplace');

  const subTabs = [
    { id: 'marketplace', name: 'Marketplace' },
    { id: 'my-listing', name: 'My Listing' },
  ];

  const renderContent = () => {
    switch (activeSubTab) {
      case 'marketplace':
        return <MarketplaceListings />;
      case 'my-listing':
        return <MyListing />;
      default:
        return <MarketplaceListings />;
    }
  };

  return (
    <Fragment>
      <div>
        <h1 className="text-xl font-semibold text-gray-900">Marketplace</h1>
        <p className="text-gray-600 text-sm mb-6">
          Discover and connect with businesses offering specialized services, or showcase your own expertise to potential clients. 
          The marketplace is a vibrant ecosystem where startups, freelancers, and established companies can find the perfect partners 
          for their business needs. Whether you're looking for legal advice, design services, technical expertise, or financial consulting, 
          our curated marketplace connects you with trusted professionals who understand the unique challenges of growing businesses.
        </p>
      </div>

      <SubNav
        subTabs={subTabs}
        activeSubTab={activeSubTab}
        onSubTabChange={setActiveSubTab}
      />
      <div>
        {renderContent()}
      </div>
    </Fragment>
  );
};

export default Marketplace;
